Star::Star() : m_ha(0.0), m_id(-1) {
}

Star::Star( int _id, STAR_CATALOG _cat  ) :  m_ha(0.0), m_id(-1) {
    if (_cat == HIP) {
        bool found = false;
        for (int i = 0; i < N_STARS; i++) {
            if (sts_hip[i] == _id) {
                _id = i;
                found = true;
                break;
            }
        }

        if (!found)
            return;
    }
    else if (_id < 0 || _id >= N_STARS ) 
        return;

    m_id = _id;
    
    m_equatorial = Equatorial(sts_data[m_id][0], sts_data[m_id][1], DEGS);
    m_mag = sts_data[m_id][2];
}

Star::Star( double _ra, double _dec, double _mag ) : m_equatorial(_ra, _dec, DEGS), m_ha(0.0), m_mag(_mag), m_id(-1) {
}

Star::~Star() {
}

double Star::getHourAngle(ANGLE_UNIT _type) const {
    if (_type == DEGS) {
        return MathOps::toDegrees(m_ha);
    }
    else {
        return m_ha;
    }
}

void Star::compute( Observer& _obs ) {
    if ( _obs.haveLocation() ) {
        m_ha = MathOps::normalize(CoordOps::toHourAngle( _obs, m_equatorial ), RADS);
        m_horizontal = CoordOps::toHorizontal( _obs, m_equatorial );
        m_bHorizontal = true;
    }
    else {
        m_ha = 0.0;
        m_horizontal[0] = 0.0;
        m_horizontal[1] = 0.0;
        m_bHorizontal = false;
    }
}

double Star::getMagnitud() const {
    return m_mag;
}

int Star::getHIP() const {
    if ( m_id < 0 || m_id >= N_STARS )
        return -1;

    return sts_hip[m_id];
}

char*  Star::getName() const {
    if ( m_id < 0 || m_id >= N_STARS )
        return ((char*)"????");
    
    int len = strlen(sts_name[m_id]);
    char *cstr = new char[len];
    strncpy(cstr, sts_name[m_id]+5, len);
    return cstr;
}

double Star::getParalax() const {
    if ( m_id < 0 || m_id >= N_STARS )
        return 0.0;

    return sts_data[m_id][4];
}

double Star::getDistance(DISTANCE_UNIT _type) const {
    if (_type == PC) {
        return 1.0/getParalax();
    }
    else if (_type == LY) {
        return getDistance(PC) * CoordOps::PC_TO_LY;
    }
    else if (_type == AU) {
        return getDistance(LY) * CoordOps::LY_TO_AU;
    }
    else if (_type == KM) {
        return getDistance(AU) * CoordOps::AU_TO_KM;
    }
    else {
        return 1.0/getParalax();
    }
}

#ifdef USE_HIPPACOS_EXTRADATA

double Star::getAbsMagnitud() const {
    if ( m_id < 0 || m_id >= N_STARS )
        return 0.0;

    return sts_data[m_id][3]; // absolute magnitud
}

double Star::getTemperature() const {
    if ( m_id < 0 || m_id >= N_STARS )
        return 0.0;

    return sts_data[m_id][5];
}

double Star::getVB() const {
    if ( m_id < 0 || m_id >= N_STARS )
        return 0.0;

    return sts_data[m_id][6];
}

#endif
